import React from 'react';

export default function RecipeSelect(props) {
    const {recipe, setLoaded} = props;

    return (
        <div>
            <h1>
                Here is your recipe!
            </h1>
            <p>{recipe}</p>
            {console.log(recipe)}
            <button onClick={() => setLoaded(false)}>Go Back</button>
        </div>

    )
}
